def unique(marker):
    for e in marker:
        if marker.count(e) > 1:
            return False
    return True

def main(input):
    marker = input[:13]
    index = 14
    for element in input[13:]:        
        marker = marker + element

        if (len(marker) > 14):
            marker = marker[1:]

        if unique(marker):
            return index

        index = index + 1

if __name__ == '__main__':
    for ex in examples:
        print(main(ex))